import React, { useState, useEffect } from 'react';
import './App.css';
import axios from "axios";
axios.defaults.proxy.host = "http://localhost:8080"

import Table from "./components/Table";

const getInitialResults = async () => {
  return await axios({
    method: "get",
    url: "/",
    timeout: 60 * 4 * 1000
  });
}

const App = () => {
  useEffect(() => {
    const result = getInitialResults();
    // fetch("http://localhost:8080")
    // console.log(result);
  }, []);
  return (
    <div className="App">
      <Table />
    </div>
  );
}

export default App;
